import './App.css';
import BudgetCalculator from './BudgetCalculator.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
              <h1>BSU In-Patient Nurse Staffing Simulator</h1>
                      <p class="lead">
            Hospital unit is ___ and HPPD is ___. You census is ___% full in a bed unit. Allocate you resources accordingly.
            </p>

            <button onclick="AtHomePractice()">At Home Practice</button>

      </header>
      <BudgetCalculator />
    </div>

  );
}

export default App;
